// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/EnumerableSet.sol";

contract FwarMarketStorage {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    struct OrderInfo {
        // NFT owner
        address owner;
        // NFT contract address
        address nftContract;
        // NFT Ids
        uint[] nftIds;
        // pay token;
        address token;
        // pay amount;
        uint price;
        // order expiration time
        uint expiration;
        // order expiration time
        uint createTime;
    }

    uint public maxExpirationTime;

    uint public minExpirationTime;


    EnumerableSet.UintSet internal orderIds;

    mapping(uint => OrderInfo) orders;

    mapping(uint => mapping(address => uint)) sellingNFT;

    mapping(address => uint) nftAdds;
    mapping(address => uint) tokenAdds;

    address public feeTo;

    //Seed Address
    address public seedAddress;

    //FwarBlackList Address
    address public blackListAddress;

    // fee rate scaled by 1e12
    uint public feeRate; 
}
